import React from "react";
import { Link } from "react-router-dom";

const Button = ({ children, linkto }) => {
  return (
    <Link to={linkto}>
      <div className="text-center px-6 py-3 font-bold text-lg rounded-md hover:scale-95 transition-all duration-200 bg-yellow-50 text-richblack-800">
        {children}
      </div>
    </Link>
  );
};

export default Button;
